import { useLocation } from 'react-router-dom';

function ConsultaDetalhe() {
  const { state } = useLocation();
  const consulta = state?.consulta;

  if (!consulta) return <p>Consulta não encontrada.</p>;

  return (
    <div style={{ padding: '2rem' }}>
      <h2>Detalhes da Consulta</h2>
      <p><strong>Pet:</strong> {consulta.pet}</p>
      <p><strong>Tutor:</strong> {consulta.nome_tutor}</p>
      <p><strong>Idade:</strong> {consulta.idade_pet}</p>
      <p><strong>Telefone:</strong> {consulta.Telefone}</p>
      <p><strong>Email:</strong> {consulta.Email}</p>
      <p><strong>Endereço:</strong> {consulta.Rua}, {consulta.Cidade} - {consulta.Estado}</p>
      <p><strong>Motivo:</strong> {consulta.Motivo}</p>
      <p><strong>Data:</strong> {new Date(consulta.Data).toLocaleDateString()}</p>
      <p><strong>Horário:</strong> {consulta.Horario}</p>
    </div>
  );
}

export default ConsultaDetalhe;
